import React from 'react'
import { Redirect } from 'react-router-dom'
import { getTokenFromStorage } from '../helpers'

const  PrivateRoute = ({children , ...rest}) => {

  return (
   <Route  {...rest}>
    {getTokenFromStorage
    ?
    <Redirect to="/login" />:
    children}
    </Route>
  )
}

export default PrivateRoute
